interface CountyProps extends ConstituencyProps {
  id: Constituency;
  onCountyClicked: Function;
  activeCountyId: string;
}

const County: React.FC<CountyProps> = (props) => {
  const { color, paths, id, name, onCountyClicked, activeCountyId } = props;
  return (
    <>
      {paths.map((path, index) => (
        <path
          onClick={() => onCountyClicked()}
          key={`${name}_${index}`}
          d={path}
          fill={activeCountyId === props.id ? "#f00" : color}
          id={`${id}_${index}`}
          onMouseOver={() => console.log(`Valgkrets: ${name}`)}
        />
      ))}
    </>
  );
};
